import React, { Component } from 'react';
import './css/Projects.css'
import { Link } from 'react-router-dom';

class Projects extends Component {
  render() {
    const projects = [
      { name: 'MongoDB', describe: 'Querys para buscar dados em um banco de dados NoSQL - MongoDb', link: '/about' }
    ];
    return (
      <section className="boxSkills">
        <div className="boxTech">
          <h4 className="tamanhoc" id="conhecimento"><strong>Conhe√ßa meus projetos:</strong></h4>        
          {
            projects.map((project, key) =>
              <Link className="tamanhoc2" to={ project.link } key={ key }>
                <span>{ project.name }</span>
                <br />
                <span>{ project.describe }</span>
              </Link>
            )
          }
        </div>
      </section>
  )
  }
}

export default Projects;
